  [],\n\t\"revision_timestamp\": \"2015-07-08T19:19:53.697744\",\n\t\"name\": \"omi-aura-ozone-o3-profile-1-orbit-l2-swath-13x48km-v003\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The OMI/Aura Level-2 Ozone Profile data
  product OMO3PR (Version 003) is now available ( http://disc.gsfc.nasa.gov/Aura/OMI/omo3pr_v003.shtml
  ) from the NASA Goddard Earth Sciences Data and Information Services Center (GES
  DISC) for the public access. nnOMI Level-2 ozone profile product, OMO3PR at the
  pixel resolution 13x 48 km (at nadir), is based on the optimal estimation algorithm
  (Rodgers, 2000) with climatological ozone profiles as a-priori information. The
  OMO3PR retrieval algorithm uses spectral radiance values from the UV1 channel (270
  nm to 308.5 nm) and from the first part of the UV2 channel (311.5 nm to 33 0 nm).
  OMO3PR product provides ozone values (in Dobson unit) for 18 atmospheric layers.
  It also provides a-priori ozone profile values, error covariance matrix, averaging
  kernel and some ancillary information such as time, latitude, longitude, solar zenith
  and viewing zenith angles and quality flags . nn(The short name for this Level-2
  OMI ozone profile product is OMO3PR)nThe lead scientist for this product is Dr.
  Johan de Haan (johan.de.haan@knmi.nl). nnOMO3PR product files are stored in Hierarchical
  Data Format (HDF-EOS5 ).  Each file contains data from the day lit portion of an
  orbit (approx 53 minutes). There are approximately 14 orbits per day thus the total
  data volume is approximately 150 GB/day. A list of tools for browsing and extracting
  data from these files can be found at:  http://disc.gsfc.nasa.gov/Aura/tools.shtmlnnA
  'Readme' document containing brief algorithm description and known data quality
  related issues and file spec are provided by the OMO3PR algorithm lead (see http://disc.gsfc.nasa.gov/Aura/OMI/omo3pr_v003.shtml
  ).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
